CREATE TABLE mytable(
   born_in        VARCHAR(27) NOT NULL PRIMARY KEY
  ,category       VARCHAR(22)
  ,date_of_birth  VARCHAR(17)
  ,date_of_death  VARCHAR(17)
  ,gender         VARCHAR(6)
  ,link           VARCHAR(81) NOT NULL
  ,name           VARCHAR(52) NOT NULL
  ,nationality    VARCHAR(27)
  ,place_of_birth VARCHAR(52)
  ,place_of_death VARCHAR(28)
  ,text           VARCHAR(170) NOT NULL
  ,year           INTEGER  NOT NULL
);
